import React from 'react';
import Header from './components/Header';
import Projects from './components/Projects';
import Contact from './components/Contact';
import './styles.css'; // Импортируем общий файл стилей

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <section id="about">
          <h2>About Me</h2>
          <p>Hi! I'm Maxim, a 17-year-old aspiring programmer...</p>
        </section>
        <Projects />
        <Contact />
      </main>
      <footer>
        <p>&copy; 2024-2025 Maxim's Portfolio</p>
      </footer>
    </div>
  );
}

export default App;
